import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const myElement = document.getElementById('myElement');
console.log(myElement); // shows [object HTMLDivElement]
console.log(myElement.outerHTML); // shows the HTML code of the element


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
